import React, { useState } from 'react';
import {Modal ,Button} from 'antd'
import {Container} from './style';

export default function Parecer({visible, setVisible}){
    return(
        <Modal 
        visible={visible}
        title="Parecer"
        onOk={this.handleOk}
        onCancel={()=>setVisible(false)}
        >

        </Modal>
    );
}
